import React from "react";
import { connect } from "react-redux";

const App = props => {
  console.log(props.customerList);
  return <div></div>;
};

const mapStateToProps = state => {
  return {
    customerList: state.customerList
  };
};

export default connect(mapStateToProps)(App);
